INSERT INTO `kayapo_blocks` VALUES (17,'','Webmail','<script language=javascript>\r\nfunction validar(form1) { \r\n\r\nif (document.form1.f_email.value==\"\") {\r\nalert(\"O Campo E-mail não está preenchido!\")\r\nform1.f_email.focus();\r\nreturn false\r\n}\r\n\r\nif (document.form1.f_pass.value==\"\") {\r\nalert(\"O Campo Senha não está preenchido!\")\r\nform1.f_pass.focus();\r\nreturn false\r\n}\r\n\r\n}\r\n\r\n</SCRIPT>\r\n<table width=\"100%\" border=\"0\">\r\n  <FORM name=\"form1\" action=\"http://webmail.codemau.org.br/horde/process.php\" method=\"post\" method=post onSubmit=\"return validar(this)\" target=_blank><tr>\r\n    <td width=\"6%\">E-mail:</td>\r\n    <td width=\"94%\"><INPUT class=normal size=\"19\" type=text name=f_email>\r\n    *</td>\r\n  </tr>\r\n  <tr>\r\n    <td>Senha:</td>\r\n    <td><INPUT class=normal size=\"19\" type=password \r\n                  name=f_pass>\r\n    *</td>\r\n  </tr>\r\n</table>\r\n<table width=\"100%\" border=\"0\">\r\n  <tr>\r\n    <td width=\"94%\"><div align=\"center\">\r\n        <input class=\"botao\" type=\"submit\" value=\"Acessar\" />&nbsp;&nbsp;<input class=\"botao\" type=\"reset\" value=\"Limpar\" />\r\n    </div></td>\r\n  </tr></FORM>\r\n</table>','','l',6,1,0,'','','',0,'','0','d',0);
