INSERT INTO `kayapo_events` VALUES (6,'','Votação da Consulta Popular 2008 orçamento 2009','2008-06-11 09:46:59','Sendo que uma urna cada Município, de facil acesso, deverá ficar aberta a votação até as 21:00. E ainda os eleitores poderão votar pelo site www.ppp.rs.gov.br, sendo que internet os votos serão dos horarios das 08:00 as 23:30 min.<br />\r\n<br />\r\nOBS: salientando que os eleitores tanto por cedula bem como via internet deverão ter juntos o seu Titulo de Eleitor e sua Cedula de Identidade - RG.',0,0,0,'Visitante','2008-06-25','2008-06-25','09:00:00','18:00:00',0,'y');
