INSERT INTO `kayapo_pages` VALUES (14,10,'Missão','',1,'A miss&atilde;o do CODEMAU &eacute;:','<p align=\"justify\"><font face=\"Verdana\" size=\"2\">A Miss&atilde;o dos COREDES &eacute; ser espa&ccedil;o plural e aberto de constru&ccedil;&atilde;o de parcerias sociais e econ&ocirc;micas, em n&iacute;vel regional, atrav&eacute;s da articula&ccedil;&atilde;o pol&iacute;tica dos interesses locais e setoriais em torno de estrat&eacute;gias pr&oacute;prias e espec&iacute;ficas de desenvolvimento para as regi&otilde;es do Rio Grande do Sul.</font></p>','','','2008-04-24 10:35:52',3,'brazilian');
INSERT INTO `kayapo_pages` VALUES (15,10,'Objetivos','',1,'<p align=\"justify\"><font face=\"Verdana\" size=\"2\">Os principais objetivos dos COREDES s&atilde;o:</font></p>','<p align=\"justify\"><font face=\"Verdana\" size=\"2\">a)&nbsp;formular e executar estrat&eacute;gias regionais, consolidando-as em planos estrat&eacute;gicos de desenvolvimento regional;<br/>b)&nbsp;avan&ccedil;ar a participa&ccedil;&atilde;o social e cidad&atilde;, combinando m&uacute;ltiplas formas de democracia direta com representa&ccedil;&atilde;o pol&iacute;tica;<br/>c)&nbsp;constituir-se em inst&acirc;ncia de regionaliza&ccedil;&atilde;o das estrat&eacute;gias e das a&ccedil;&otilde;es do Executivo, Legislativo e Judici&aacute;rio, do Rio Grande do Sul, conforme estabelece a Constitui&ccedil;&atilde;o do Estado;<br/>d)&nbsp;avan&ccedil;ar na constru&ccedil;&atilde;o de espa&ccedil;os p&uacute;blicos de controle social dos mercados e dos mais diversos aparelhos do Estado;<br/>e)&nbsp;conquistar e estimular a crescente participa&ccedil;&atilde;o social e cidad&atilde; na defini&ccedil;&atilde;o dos rumos do processo de desenvolvimento;<br/>f)&nbsp;intensificar o processo de constru&ccedil;&atilde;o de uma organiza&ccedil;&atilde;o social pr&oacute;-desenvolvimento regional;<br/>g)&nbsp;difundir a filosofia e a pr&aacute;tica cooperativa de se pensar e fazer o desenvolvimento regional em parceria.<br/></font></p>','','','2008-04-24 10:42:08',3,'brazilian');
INSERT INTO `kayapo_pages` VALUES (16,10,'Principios ','',1,'<p align=\"justify\"><font face=\"Verdana\" size=\"2\">Os principais principios que norteiam os COREDES</font></p>','<p align=\"justify\"><font face=\"Verdana\" size=\"2\">a) Promo&ccedil;&atilde;o de Desenvolvimento Regional;<br/>b) Autonomia;<br/>c) Pluralidade e Identifica&ccedil;&atilde;o de Consensos;<br/>d) Confian&ccedil;a, Coopera&ccedil;&atilde;o e Forma&ccedil;&atilde;o de Parcerias;<br/>e) Integra&ccedil;&atilde;o, Articula&ccedil;&atilde;o e Consolida&ccedil;&atilde;o das Identidades Regionais;<br/>f) Busca da Regionaliza&ccedil;&atilde;o das Pol&iacute;ticas de Desenvolvimento;<br/>g) Aumento Permanente da Representatividade e da Organiza&ccedil;&atilde;o;<br/>h) Apoio &agrave; Continuidade das Pol&iacute;ticas P&uacute;blicas de Interesse Regional.</font></p>','','','2008-04-24 10:55:51',5,'brazilian');
