INSERT INTO `kayapo_pages` VALUES (19,13,'Em andamento','Programa Regional de Piscicultura',1,'<p align=\"justify\"><font face=\"Verdana\" size=\"2\"><strong>O que &eacute;:</strong></font></p><ul><li><div><font face=\"Verdana\" size=\"2\">O programa &eacute; a soma da uni&atilde;o de esfor&ccedil;os de diferentes entidades engajadas nesta atividade, buscando proporcionar uma nova alternativa de renda para a popula&ccedil;&atilde;o da regi&atilde;o do M&eacute;dio Alto Uruguai ga&uacute;cho.&nbsp;</font></div></li><li><div><font face=\"Verdana\" size=\"2\">O programa foi constitu&iacute;do a partir da necessidade da regi&atilde;o desenvolver toda a cadeia produtiva da piscicultura, desde a produ&ccedil;&atilde;o de alevinos at&eacute; o processamento do peixe e sua comercializa&ccedil;&atilde;o, agregando valor e renda a atividade. </font></div></li><li><div><font face=\"Verdana\" size=\"2\">O programa busca elaborar um Planejamento Estrat&eacute;gico a m&eacute;dio e longo prazo para a Cadeia Produtiva da Piscicultura.<br/></font></div></li></ul>','<p align=\"justify\"><font face=\"Verdana\" size=\"2\">Objetivos:</font></p><ul><li><div align=\"justify\"><font face=\"Verdana\" size=\"2\">Promover o desenvolvimento da piscicultura regional de maneira sustentada, atrav&eacute;s da pesquisa, gera&ccedil;&atilde;o e transfer&ecirc;ncias de tecnologias ao setor produtivo, visando o aumento da produtividade e rentabilidade &agrave;s propriedades rurais;</font></div></li><li><div align=\"justify\"><font face=\"Verdana\" size=\"2\">Fortalecer a piscicultura atrav&eacute;s da capacita&ccedil;&atilde;o de produtores e t&eacute;cnicos, visando profissionalizar o setor, gerando novas alternativas de renda a agricultura familiar;</font></div></li><li><div align=\"justify\"><font face=\"Verdana\" size=\"2\">Fomentar a cadeia produtiva da piscicultura, desde a pesquisa de alevinos,&nbsp; at&eacute; o processamento de peixes, buscando agregar valor e&nbsp; renda&nbsp; na atividade;</font></div></li><li><div align=\"justify\"><font face=\"Verdana\" size=\"2\">Proporcionar uma nova alternativa de renda de forma sustent&aacute;vel para a popula&ccedil;&atilde;o da regi&atilde;o do M&eacute;dio Alto Uruguai;</font></div></li><li><div align=\"justify\"><font face=\"Verdana\" size=\"2\">Prover os produtores de peixe de novas tecnologias auxiliando desta forma para o aumento da produtividade e qualidade do peixe; </font></div></li><li><div align=\"justify\"><font face=\"Verdana\" size=\"2\">Aproveitar os subprodutos oriundos da filetagem de peixe, como forma de agregar ainda mais renda a atividade, como exemplo o artesanato feito com a pele do peixe; </font></div></li><li><div align=\"justify\"><font face=\"Verdana\" size=\"2\">Instituir na regi&atilde;o um jantar t&iacute;pico a base de peixe, feito de forma itinerante nos munic&iacute;pios participantes do Programa;</font></div></li><li><div align=\"justify\"><font face=\"Verdana\" size=\"2\">Elaborar um Plano Estrat&eacute;gico de Desenvolvimento do Arranjo Produtivo Local de Piscicultura;</font></div></li><li><div align=\"justify\"><font face=\"Verdana\" size=\"2\">Ampliar a produ&ccedil;&atilde;o de peixes junto as propriedades rurais da regi&atilde;o;</font></div></li><li><div align=\"justify\"><font face=\"Verdana\" size=\"2\">Buscar novas parceiras e parceiros neste segmento t&atilde;o importante para a regi&atilde;o;</font></div></li><li><div align=\"justify\"><font face=\"Verdana\" size=\"2\">Despertar uma nova cultura regional sobre o consumo e produ&ccedil;&atilde;o de peixes;</font></div></li><li><div align=\"justify\"><font face=\"Verdana\" size=\"2\">Tornar a regi&atilde;o como refer&ecirc;ncia na produ&ccedil;&atilde;o de peixes processados dentro do Estado do Rio Grande do Sul;<br/></font></div></li></ul>','<p align=\"justify\"><font face=\"Verdana\" size=\"2\">Parceiros:</font></p><ul><li><div><font face=\"Verdana\" size=\"2\">P&Oacute;LO DE MODERNIZA&Ccedil;&Atilde;O TECNOL&Oacute;GICA DA URI &ndash; CAMPUS FRED WEST &ndash; ESTA&Ccedil;&Atilde;O DE PISCICULTURA;</font></div></li><li><div><font face=\"Verdana\" size=\"2\">P&Oacute;LO DE AQUICULTURA E PESCA DA MACRO NORTE&nbsp; DO ESTADO DO RIO GRANDE DO SUL;</font></div></li><li><div><font face=\"Verdana\" size=\"2\">MESORREGI&Atilde;O GRANDE FRONTEIRA DO MERCOSUL;</font></div></li><li><div><font face=\"Verdana\" size=\"2\">MINIST&Eacute;RIO DA INTEGRA&Ccedil;&Atilde;O NACIONAL;</font></div></li><li><div><font face=\"Verdana\" size=\"2\">SECRETARIA DE AQUICULTURA E PESCA DO GOVERNO FEDERAL;</font></div></li><li><div><font face=\"Verdana\" size=\"2\">COL&Ocirc;NIA DE PESCADORES Z &ndash; 22;</font></div></li><li><div><font face=\"Verdana\" size=\"2\">PREFEITURA MUNICIPAL DE CAI&Ccedil;ARA;</font></div></li><li><div><font face=\"Verdana\" size=\"2\">COOPERATIVA TRITICOLA DE FREDERICO WESTPHALEN (COTRIFRED);</font></div></li><li><div><font face=\"Verdana\" size=\"2\">SICREDI ALTO URUGUAI;</font></div></li><li><div><font face=\"Verdana\" size=\"2\">SINDICATOS DOS TRABALHADORES RURAIS DO M&Eacute;DIO ALTO URUGUAI;</font></div></li><li><div><font face=\"Verdana\" size=\"2\">EMATER/RS;</font></div></li><li><div><font face=\"Verdana\" size=\"2\">COMIT&Ecirc; DE GERENCIAMENTO DOS RECURSOS H&Iacute;DRICOS DO RIO DA V&Aacute;RZEA;</font></div></li><li><div><font face=\"Verdana\" size=\"2\">ASSOCIA&Ccedil;&Atilde;O DAS C&Acirc;MARAS DE VEREADORES DO M&Eacute;DIO AUTO URUGUAI (ACVERMAU);</font></div></li></ul><p></p>','','2008-04-24 11:21:15',14,'brazilian');
INSERT INTO `kayapo_pages` VALUES (28,12,'O que é a Consulta Popular','',1,'<p align=\"justify\"><font face=\"Verdana\" size=\"2\">A participa&ccedil;&atilde;o popular sempre foi marca da sociedade ga&uacute;cha. Desde a Revolu&ccedil;&atilde;o Farroupilha, onde o povo lutou contra a domina&ccedil;&atilde;o. O Estado do Rio Grande do Sul se caracteriza como um povo participante, sempre engajado nas causas sociais.</font> </p>','<p><font face=\"Verdana\" size=\"2\">Por&eacute;m, a n&iacute;vel estadual, somente no ano de 1998, a participa&ccedil;&atilde;o popular foi utilizada para defini&ccedil;&atilde;o de investimentos oriundos do or&ccedil;amento p&uacute;blico, onde os eleitores foram convidados a ir para as urnas ajudar a escolher as prioridades e projetos que o Governo Estadual iria direcionar suas a&ccedil;&otilde;es e investimentos. Tal participa&ccedil;&atilde;o estava embasada atrav&eacute;s do Projeto de Lei 11.179/98 e regulamentada pelo Decreto 38.610/98, a qual recebeu o nome de Consulta Popular. Posterior a este processo, no ano de 1999 o governador da &eacute;poca criou outra forma do cidad&atilde;o participar das decis&otilde;es, intitulada de Or&ccedil;amento Participativo com os mesmos objetivos. J&aacute; no ano de 2003, o Governo do Estado com o apoio e participa&ccedil;&atilde;o ativa dos COREDEs, criou o Processo de Participa&ccedil;&atilde;o Popular, respaldado pela Lei n&deg; 11.179 de 11 de Junho de 1998 e alterada pela Lei 11.920 de 10/06/2003 e regulamentada pelo decreto 43.167 de 17 de junho de 2004. Os principais objetivos desse processo s&atilde;o: <br/>* A promo&ccedil;&atilde;o do desenvolvimento regional harm&ocirc;nico e sustent&aacute;vel;<br/>* A integra&ccedil;&atilde;o dos recursos e das a&ccedil;&otilde;es do governo na regi&atilde;o; <br/>* A melhoria da qualidade de vida da popula&ccedil;&atilde;o;<br/>* A distribui&ccedil;&atilde;o eq&uuml;itativa da riqueza produzida;<br/>* O est&iacute;mulo &agrave; perman&ecirc;ncia do homem em sua regi&atilde;o; <br/>* A preserva&ccedil;&atilde;o e recupera&ccedil;&atilde;o do meio ambiente.</font></p><p align=\"justify\"><font face=\"Verdana\" size=\"2\">Com isso, os COREDEs sentiram-se fortalecidos e respaldados por parte do governo estadual, onde o mesmo buscou formar uma parceria s&eacute;ria e de credibilidade visando &agrave; participa&ccedil;&atilde;o do cidad&atilde;o quando da escolha das prioridades que ele julga mais importante para desenvolver sua cidade e regi&atilde;o. Come&ccedil;a com isso todo um trabalho voltado para o desenvolvimento e sustentabilidade das mais diversas regi&otilde;es do estado, visando assim o crescimento harm&ocirc;nico e sustent&aacute;vel do Estado como um todo. </font></p><p align=\"justify\"><font face=\"Verdana\" size=\"2\">A coordena&ccedil;&atilde;o do Processo de Participa&ccedil;&atilde;o Popular a n&iacute;vel estadual est&aacute; a cargo hoje do Secret&aacute;rio de Rela&ccedil;&otilde;es Institucionais Celso Bernardi. Nas mais diversas regi&otilde;es do Estado a coordena&ccedil;&atilde;o fica a cargo de cada Conselho Regional de Desenvolvimento &ndash; COREDEs. Os COREDES fazem toda a articula&ccedil;&atilde;o com os munic&iacute;pios e comunidade regional para participar do processo em todas as suas etapas. O Processo de Participa&ccedil;&atilde;o Popular divide-se em quatro etapas, sendo elas: </font></p><p align=\"justify\"><font face=\"Verdana\" size=\"2\">1- Audi&ecirc;ncia P&uacute;blica Regional; onde &eacute; apresentado para a comunidade regional, os programas de cada Secretaria, os quais podem ser priorizados na Consulta Popular, bem como, apresenta&ccedil;&atilde;o das finan&ccedil;as p&uacute;blicas e o valor destinado para a Consulta Popular de cada regi&atilde;o (COREDE) por parte do Governo Estadual;</font></p><p align=\"justify\"><font face=\"Verdana\" size=\"2\">2 - Assembl&eacute;ias Municipais; Realizada em todos os munic&iacute;pios que possuem Conselhos Municipais de Desenvolvimento &ndash; COMUDEs, para que os eleitores portando o t&iacute;tulo de eleitor, levantem as demandas e prioridades mais importantes&nbsp; de seu munic&iacute;pio e regi&atilde;o. </font></p><p align=\"justify\"><font face=\"Verdana\" size=\"2\">3-Assembl&eacute;ia P&uacute;blica Regional Ampliada; Realizada em &acirc;mbito regional, onde os representantes dos munic&iacute;pios juntamente com a Coordena&ccedil;&atilde;o Regional da Consulta Popular sistematizam a lista de vota&ccedil;&atilde;o, bem como definem crit&eacute;rios que reger&atilde;o a Consulta Popular na regi&atilde;o, sempre obedecendo ao que est&aacute; na lei que rege o Processo de Participa&ccedil;&atilde;o Popular.</font></p><p align=\"justify\"><font face=\"Verdana\" size=\"2\">4 - Consulta Popular;.Dia que todo e qualquer cidad&atilde;o, portando o t&iacute;tulo de eleitor pode ir a urna escolher quais as demandas que ele julga mais importante para o desenvolvimento de seu munic&iacute;pio, regi&atilde;o e estado. Sempre obedecendo aos crit&eacute;rios pr&eacute;-estabelecidos e embasados por lei.</font></p><p align=\"justify\"><font face=\"Verdana\" size=\"2\">O CODEMAU conseguiu destacar-se a n&iacute;vel estadual pela sua performance diante dos demais COREDES, sempre obtendo altos &iacute;ndices de participa&ccedil;&atilde;o, sendo que no ano de 2003, o CODEMAU obteve o s&eacute;timo lugar em participa&ccedil;&atilde;o, em 2004, o quinto lugar. Nos anos de 2005 e 2006, o CODEMAU obteve o primeiro lugar em participa&ccedil;&atilde;o a n&iacute;vel estadual, sagrando-se campe&atilde;o em participa&ccedil;&atilde;o em dois anos consecutivos, isso muito nos orgulha e nos respalda para que possamos cobrar do Governo Estadual o pronto atendimento das demandas elencadas quando das Consultas Populares, pois a comunidade regional respondeu ativamente ao chamamento para participar da discuss&atilde;o e escolha das a&ccedil;&otilde;es mais importantes para desenvolver a regi&atilde;o. Resta portanto, o Governo cumprir a sua parte, ou seja, liberar os recursos para atender as demandas priorizadas pela comunidade.</font></p><p align=\"justify\"><font face=\"Verdana\" size=\"2\">Para que a regi&atilde;o do CODEMAU conseguisse obter esses &iacute;ndices significativos, houve um engajamento e ativa participa&ccedil;&atilde;o de todas as lideran&ccedil;as regionais, prefeitos municipais, presidentes de COMUDES, imprensa escrita e falada, c&acirc;maras de vereadores, organiza&ccedil;&otilde;es governamentais e n&atilde;o governamentais. O engajamento maior foi do cidad&atilde;o, que respondeu ativamente ao chamamento para participar deste processo nas duas etapas, quando da Assembl&eacute;ia P&uacute;blica Municipal e depois no dia da Consulta Popular, levando consigo seu t&iacute;tulo de eleitor, que &eacute; a credencial para que ele possa opinar e votar nas demandas que ele julga mais importantes e necess&aacute;rias para desenvolver o seu munic&iacute;pio e regi&atilde;o.<br/>A coordena&ccedil;&atilde;o regional da Consulta Popular coordenado pelo CODEMAU sempre se empenhou muito na condu&ccedil;&atilde;o de todo o Processo nos trinta munic&iacute;pios integrantes do CODEMAU, mobilizando e sensibilizando toda a comunidade da import&acirc;ncia de participar do Processo de Participa&ccedil;&atilde;o Popular- Consulta Popular, objetivando garantir recursos para desenvolver ainda mais a regi&atilde;o do M&eacute;dio Alto Uruguai. Ressalta-se ainda que a equipe da coordena&ccedil;&atilde;o regional da Consulta Popular trabalhou exaustivamente nos meses que antecederam os Processos de Participa&ccedil;&atilde;o Popular &ndash; Consulta Popular para que o processo acontecesse da melhor maneira poss&iacute;vel. </font></p><p align=\"justify\"><font face=\"Verdana\" size=\"2\">Destacamos tamb&eacute;m que a Universidade Regional Integrada do Alto Uruguai e das Miss&otilde;es deu total apoio a todo o Processo, disponibilizando carros com motoristas para realizar as Assembl&eacute;ias P&uacute;blicas Municipais, bem como profissionais que muito contribu&iacute;ram para o bom &ecirc;xito do processo.</font></p>','<p align=\"justify\"><font face=\"Verdana\" size=\"2\">O Processo de Participa&ccedil;&atilde;o Popular &ndash; Consulta Popular conseguiu despertar em toda a comunidade ga&uacute;cha&nbsp; o esp&iacute;rito de cidad&atilde;o consciente de sua responsabilidade, que junto com o Governo do Estado, COREDES, COMUDES elencou projetos e a&ccedil;&otilde;es priorit&aacute;rias para fomentar o desenvolvimento do Rio Grande do Sul como um todo.</font></p><p align=\"justify\"><font face=\"Verdana\" size=\"2\"></font></p><p align=\"justify\"><font size=\"2\"><font face=\"Verdana\"><font color=\"#ff0000\"><strong>OBS:</strong></font>&nbsp;Maiores informa&ccedil;&otilde;es e dowland&nbsp;das demandas eleitas nas Consultas Populares estao dispon&iacute;veis dentro do&nbsp;<font color=\"#ff0000\">Menu / Publica&ccedil;&otilde;es / Consultas Populares</font>&nbsp;</font></font></p>','','2008-04-30 10:27:57',11,'brazilian');
INSERT INTO `kayapo_pages` VALUES (30,14,'O que é:','',1,'<p align=\"justify\"><font face=\"Verdana\" size=\"2\">Com o intuito de valorizar a mulher ga&uacute;cha, o Governo do Estado atrav&eacute;s da Coordenadoria da Mulher e o F&oacute;rum dos COREDES, institu&iacute;ram no ano de 2005 o Trof&eacute;u Ana Terra, premia&ccedil;&atilde;o inspirada na personagem da obra O tempo e o Vento, do escritor ga&uacute;cho &Eacute;rico Ver&iacute;ssimo, que tem como objetivo premiar as mulheres ga&uacute;chas que se destacam pelo seu trabalho e por sua dedica&ccedil;&atilde;o.</font></p>','<p align=\"justify\"><font face=\"Verdana\" size=\"2\">Dessa forma, o CODEMAU em parceria com os COMUDEs da regi&atilde;o, realizou nos anos de 2005 e 2006 a escolha da mulher destaque da regi&atilde;o, que no dia 08 de mar&ccedil;o dos respectivos anos (dia internacional da mulher) recebeu um trof&eacute;u do Governo do Estado, em cerim&ocirc;nias realizadas na capital do Estado.</font></p><p align=\"justify\"><font face=\"Verdana\" size=\"2\"><font face=\"Verdana\" size=\"2\">Os principais quesitos avaliados para a escolha da mulher destaque foram os seguintes:</font></font></p><font face=\"Verdana\" size=\"2\"><font face=\"Verdana\" size=\"2\"><p align=\"justify\">- Lideran&ccedil;a na condu&ccedil;&atilde;o dos trabalhos nas &aacute;reas de educa&ccedil;&atilde;o, sa&uacute;de, gera&ccedil;&atilde;o de trabalho e renda, cultura, pol&iacute;tica, administra&ccedil;&atilde;o p&uacute;blica e administra&ccedil;&atilde;o de institui&ccedil;&otilde;es comunit&aacute;rias;</p><p align=\"justify\">- Lideran&ccedil;a na condu&ccedil;&atilde;o de trabalho assistencial em entidades de atua&ccedil;&atilde;o junto a grupos mais vulner&aacute;veis (crian&ccedil;as, adolescentes, idosos e portadores de necessidades especiais) e em movimentos sociais no campo da solidariedade e na perspectiva de inclus&atilde;o social;</p><p align=\"justify\">- Dedica&ccedil;&atilde;o a estudos e trabalhos cient&iacute;ficos em benef&iacute;cios da popula&ccedil;&atilde;o em geral.&nbsp;<br/></p></font><font face=\"Verdana\" size=\"2\"></font><p align=\"justify\"><font face=\"Verdana\" size=\"2\">Na regi&atilde;o do CODEMAU foi eleita no ano de 2005 como mulher destaque da regi&atilde;o a Sra. Elsa Rigon do munic&iacute;pio de Seberi que recebeu um trof&eacute;u das m&atilde;os do Vice-Governador da &eacute;poca, Antonio Hohlfeldt, em cerim&ocirc;nia realizada no Pal&aacute;cio Piratini. No ano de 2006 a premiada foi a Sra. Alzira da Silva Santos do munic&iacute;pio de Palmitinho, que recebeu um trof&eacute;u da Governadora do Estado Yeda Crusius, em cerim&ocirc;nia realizada no Theatro S&atilde;o Pedro, em Porto Alegre. E no ano de 2007 foi eleita a Sr. Beatriz Salete Ortigara representante do COMUDE de Seberi, a qual foi recepcionada pela governadora Yeda Crusius juntamente com as&nbsp; outras 24 mulheres representantes dos demais COMUDES, tendo como local da solenidade o Theatro S&atilde;o Pedro em Porto Alegre.<br/></font></p></font>','','','2008-05-02 09:54:49',6,'brazilian');
INSERT INTO `kayapo_pages` VALUES (13,10,'Informações  Institucionais','',1,'','<p align=\"justify\"><font face=\"Verdana\" size=\"2\">O COREDE M&eacute;dio Alto Uruguai &ndash; CODEMAU iniciou sua caminhada de constru&ccedil;&atilde;o e implanta&ccedil;&atilde;o em julho de 1991. Ap&oacute;s v&aacute;rias reuni&otilde;es e semin&aacute;rios realizados na regi&atilde;o do M&eacute;dio Alto Uruguai que culminou com um grande encontro em novembro de 1991, quando o ex-Governador Alceu de Deus Collares, presente ao evento realizado em Frederico Westphalen, autorizou o processo de organiza&ccedil;&atilde;o regional do Conselho, o qual foi instalado em 1992.</font></p><p align=\"justify\"><font face=\"Verdana\" size=\"2\">Os Conselhos Regionais de Desenvolvimento foram criados, legalmente, atrav&eacute;s da Lei Estadual n&ordm;. 10.238, de 01 de outubro de 1994 e regulamentados pelo Decreto n&ordm;. 35.764 de 28 de dezembro de 1994, no exerc&iacute;cio do Governador Alceu de Deus Collares, tendo como principal objetivo a promo&ccedil;&atilde;o do desenvolvimento regional harm&ocirc;nico e sustent&aacute;vel, a integra&ccedil;&atilde;o dos recursos e das a&ccedil;&otilde;es do Governo na regi&atilde;o, a distribui&ccedil;&atilde;o eq&uuml;itativa da riqueza produzida, o est&iacute;mulo &agrave; perman&ecirc;ncia do homem na regi&atilde;o, a preserva&ccedil;&atilde;o e recupera&ccedil;&atilde;o do meio ambiente, tendo como foco a melhoria da qualidade de vida da popula&ccedil;&atilde;o ga&uacute;cha.</font></p><p align=\"justify\"><font face=\"Verdana\" size=\"2\">O COREDE M&eacute;dio Alto Uruguai &ndash; CODEMAU foi o nono (9&ordm;) a ser implantado, e localiza-se no extremo norte do Rio Grande do Sul, divisa com o Estado de Santa Catarina. A regi&atilde;o &eacute; composta por 23 munic&iacute;pios, situados no extremo norte do Estado do Rio Grande do Sul, somando uma popula&ccedil;&atilde;o de 160.674 habitantes, sendo 46,64% residentes no meio urbano e 53,36% no meio rural.</font></p><p align=\"justify\"><font face=\"Verdana\" size=\"2\">A sede do COREDE M&eacute;dio Alto Uruguai &ndash; CODEMAU est&aacute; instalada em espa&ccedil;o f&iacute;sico cedido pela Universidade Regional Integrada do Alto Uruguai e das Miss&otilde;es &ndash; URI &ndash; Campus de Frederico Westphalen. Conta com log&iacute;stica adequada para atender a demanda, e uma equipe qualificada de assessores e colaboradores que atuam nas atividades de diagn&oacute;stico, elabora&ccedil;&atilde;o e execu&ccedil;&atilde;o de projetos de interesse da comunidade regional.</font></p><p align=\"justify\"><font face=\"Verdana\" size=\"2\">Destacamos que a URI &ndash; Campus de Frederico Westphalen &eacute; a principal parceira, que al&eacute;m de disponibilizar infra-estrutura, sem &ocirc;nus para o CODEMAU, tem disponibilizado log&iacute;stica para a manuten&ccedil;&atilde;o, juntamente com as Prefeituras Municipais e o Estado que contribuem, com recursos para a execu&ccedil;&atilde;o das atividades que t&ecirc;m como objetivo o desenvolvimento regional com sustentabilidade, de forma cooperativa, participativa e solid&aacute;ria, visando a melhoria da qualidade de vida da popula&ccedil;&atilde;o regional.</font></p><p align=\"justify\"><font face=\"Verdana\" size=\"2\">Os membros representantes do COREDE M&eacute;dio Alto Uruguai &ndash; CODEMAU s&atilde;o os Prefeitos Municipais, os Presidentes das C&acirc;maras de Vereadores, Parlamentares com domic&iacute;lio eleitoral na regi&atilde;o de abrang&ecirc;ncia e representantes de entidades organizadas, governamentais e n&atilde;o-governamentais, com fins ou sem fins econ&ocirc;micos.</font></p><p align=\"justify\"><font face=\"Verdana\" size=\"2\">Seguindo a miss&atilde;o, vis&atilde;o, objetivos e princ&iacute;pios do F&oacute;rum dos COREDEs, o COREDE M&eacute;dio Alto Uruguai &ndash; CODEMAU, pauta suas a&ccedil;&otilde;es em:<br/>&middot; Promover a participa&ccedil;&atilde;o de todos os segmentos da sociedade regional no diagn&oacute;stico de suas necessidades e potencialidades, para a formula&ccedil;&atilde;o e implanta&ccedil;&atilde;o das pol&iacute;ticas de desenvolvimento integrado da regi&atilde;o;&nbsp; <br/>&middot; Elaborar planos diretores e estrat&eacute;gicos de desenvolvimento regional;<br/>&middot; Manter espa&ccedil;o permanente de participa&ccedil;&atilde;o democr&aacute;tica, resgatando a cidadania, atrav&eacute;s da valoriza&ccedil;&atilde;o da a&ccedil;&atilde;o pol&iacute;tica;<br/>&middot; Constituir-se em inst&acirc;ncia de regionaliza&ccedil;&atilde;o do or&ccedil;amento do Estado, conforme estabelece o art. 149, par&aacute;grafo 8&ordm; da Constitui&ccedil;&atilde;o do Estado;<br/>&middot; Orientar e acompanhar, de forma sistem&aacute;tica, o desempenho das a&ccedil;&otilde;es do Governo Estadual e Federal na regi&atilde;o;<br/>&middot; Respaldar as a&ccedil;&otilde;es do Governo do Estado na busca de maior participa&ccedil;&atilde;o nas decis&otilde;es nacionais.&nbsp; </font></p><p align=\"justify\"><font face=\"Verdana\" size=\"2\">O COREDE M&eacute;dio Alto Uruguai &ndash; CODEMAU vem exercendo um papel extremamente importante para a regi&atilde;o que representa, como para o Governo do Estado, respeitando o pluralismo ideol&oacute;gico, religioso, &eacute;tnico e cultural, preocupando-se com o desenvolvimento regional em bases sustent&aacute;veis.<br/></font></p>','','Diretoria Executiva do CODEMAU','2008-04-24 10:32:33',7,'brazilian');
