INSERT INTO `kayapo_stories` VALUES (12,0,'codemau','Reuniao Assembléia Regional Ampliada','2008-06-03 10:47:05','<p><img style=\"WIDTH: 114px; HEIGHT: 142px\" height=\"134\" alt=\"\" src=\"/modules/FCKeditor/upload/Image/URNA.jpg\" width=\"100\"/><font face=\"Verdana\" size=\"2\">Importante reuni&atilde;o da Assembl&eacute;ia Ragional Ampliada dia <strong>10 de Junho as 09:00h</strong></font></p>','<p align=\"justify\"><font face=\"Verdana\" size=\"2\">Acontencer&aacute; no dia <strong>10 de Junho as 09:00</strong> nas depend&ecirc;ncias do Audit&oacute;rio da URI (Campus de Frederico Westphalen) uma import&acirc;nte reuniao que tratar&aacute; da <strong>Assembl&eacute;ia Regional Ampliada da Consulta Popular 2008 or&ccedil;amento 2009</strong> da regi&atilde;o do Corede M&eacute;dio Alto Uruguai.</font></p>',0,6,0,'codemau','',0,'',1,0,0,0,0,'');
INSERT INTO `kayapo_stories` VALUES (13,0,'codemau','Eleições  da Consulta Popular 2008/2009','2008-06-11 11:32:58','<p align=\"justify\"><font face=\"Verdana\" size=\"2\"><img height=\"108\" src=\"/modules/FCKeditor/upload/Image/votando.jpg\" width=\"100\" align=\"left\" alt=\"\"/>No pr&oacute;ximo dia 25 de junho&nbsp;o Rio Grande do Sul estar&aacute; realizando mais uma Consulta Popular, sendo que, a regi&atilde;o do CODEMAU j&aacute; tem as suas demandas a serem votadas, conforme aprovado em assembl&aacute;ia regional ampliada que foi realizada no dia 10/06.</font></p>','<p><font face=\"Verdana\" size=\"2\">As demandas s&atilde;o:</font></p><p><table style=\"WIDTH: 678px; HEIGHT: 300px\" cellspacing=\"1\" cellpadding=\"1\" width=\"678\" align=\"left\" border=\"1\"><caption></caption><tbody><tr><td>Fomento a Bacia Leiteira na regi&atilde;o do CODEMAU</td><td>R$&nbsp;829.800,00&nbsp;</td></tr><tr><td>Viatura Pick-up para a Brigada Militar de Planalto</td><td>R$ 120.000,00</td></tr><tr><td>Recurso para aquisi&ccedil;&atilde;o de equipamentos para novos cursos t&eacute;cnicos na E.E.T Jos&eacute; Ca&ntilde;ellas de Frederico Westphalen</td><td>R$ 80.000,00</td></tr><tr><td>Redes de Coopera&ccedil;&atilde;o na regi&atilde;o do CODEMAU</td><td>R$290.000,00&nbsp;</td></tr><tr><td>Recursos para Equipamentos - Corpo de Bombeiro</td><td>R$ 55.000,00&nbsp;</td></tr><tr><td>Custeio para os&nbsp; Hospitais S&atilde;o Jos&eacute; de Rodeio Bonito e Hospital Divina Provid&ecirc;ncia de Frederico Westphalen</td><td>R$ 200.000,00&nbsp;</td></tr><tr><td>Fomento a pesquisa na Regi&atilde;o do CODEMAU</td><td>R$ 100.000,00&nbsp;</td></tr><tr><td>Gera&ccedil;&atilde;o de renda para a Agricultures familiares na regi&atilde;o do CODEMAU</td><td>R$ 50.000,00</td></tr><tr><td><p>Constru&ccedil;&atilde;o de Rodovias na regi&atilde;o do CODEMAU</p></td><td>R$600.000,00&nbsp;</td></tr><tr><td>Implanta&ccedil;&atilde;o de Centro de Refer&ecirc;ncia da Crian&ccedil;a e Adolescente na regi&atilde;o do CODEMAU</td><td>R$90.000,00</td></tr></tbody></table></p><p></p><p></p><p></p><p></p><p></p><p></p>',0,25,0,'codemau','',0,'',1,0,0,0,0,'');
INSERT INTO `kayapo_stories` VALUES (14,0,'codemau','CODEMAU PARTICIPOU DE REUNIÃO DO FORUM DA MESOMERCOSUL EM CHAPECO','2008-06-11 17:04:12','<p align=\"justify\"><img style=\"WIDTH: 156px; HEIGHT: 84px\" height=\"134\" alt=\"\" src=\"/modules/FCKeditor/upload/Image/Foto%20Reunião%20Forum%20Mesomercosul.jpg\" width=\"200\" align=\"left\"/><font face=\"Verdana\" size=\"2\">CODEMAU esteve participando em Chapec&oacute;/SC nos dias 5 e 6 de Junho no&nbsp;Audit&oacute;rio da Associa&ccedil;&atilde;o dos Munic&iacute;pios do Oeste da Santa Catarina &ndash; AMOSC, de um importante evento coordenado pela MESORREGI&Atilde;O Grande Fronteira do Mercosul.</font></p>','<p align=\"justify\"><font face=\"Verdana\" size=\"2\">Nos dias 05 e 06 de junho o CODEMAU esteve participando em Chapec&oacute;/SC junto ao audit&oacute;rio da Associa&ccedil;&atilde;o dos Munic&iacute;pios do Oeste da Santa Catarina &ndash; AMOSC, de um importante evento coordenado pela MESORREGI&Atilde;O Grande Fronteira do Mercosul, onde no dia 05 a programa&ccedil;&atilde;o ficou direcionada ao treinamento das novas metodologias na elabora&ccedil;&atilde;o dos projetos a serem encaminhados as bases financiadoras p&uacute;blicas e privadas. Na oficina participaram todos os membros do Conselho de Representantes do F&oacute;rum da Mesomercosul bem como os t&eacute;cnicos dos grupos de elabora&ccedil;&atilde;o de projetos do F&oacute;rum da Mesorregi&atilde;o. Com dura&ccedil;&atilde;o de dois dias, a oficina de projetos objetivou contribuir para o aperfei&ccedil;oamento dos participantes sobre a elabora&ccedil;&atilde;o, execu&ccedil;&atilde;o e gerenciamento de projetos, de acordo com as exig&ecirc;ncias atuais do Governo Federal, Minist&eacute;rio da Integra&ccedil;&atilde;o Nacional (MI), entre outros.</font></p><p align=\"justify\"><font face=\"Verdana\" size=\"2\">&nbsp;Na seq&uuml;&ecirc;ncia dos trabalhos no dia 06 de junho elaborou se o planejamento estruturante do F&oacute;rum da Mesorregi&atilde;o visando &agrave;s novas pol&iacute;ticas de atua&ccedil;&atilde;o, onde foi destacado o excelente trabalho desenvolvido pela entidade, participando como interlocutora dos projetos, inclusive alguns do Codemau que foram encaminhados junto aos minist&eacute;rios, contribuindo assim para a implementa&ccedil;&atilde;o das pol&iacute;ticas de desenvolvimento regional. Segundo M&aacute;rcia Faccin, secret&aacute;ria executiva do CODEMAU e participante do evento foi uma oportunidade de adquirir novas informa&ccedil;&otilde;es e trocas de experi&ecirc;ncia na elabora&ccedil;&atilde;o e execu&ccedil;&atilde;o de projetos e a&ccedil;&otilde;es do governo federal na regi&atilde;o. Do CODEMAU participou tamb&eacute;m o senhor Mauro Cezar Rosa.</font></p>',0,4,0,'codemau','',0,'',0,0,0,0,0,'');
INSERT INTO `kayapo_stories` VALUES (15,0,'codemau','Lista de votação homologada','2008-06-16 16:39:30','<p align=\"justify\"><font face=\"Verdana\" size=\"2\"><img style=\"WIDTH: 120px; HEIGHT: 116px\" height=\"267\" alt=\"\" src=\"/modules/FCKeditor/upload/Image/URNA.jpg\" width=\"200\" align=\"left\"/>Foi homologada&nbsp;hoje pela parte da manha, 16/06/08, a lista de vota&ccedil;&atilde;o com o numeros das demandas a serem votadas no pr&oacute;ximo dia 25 de Junho na Consulta Popular 2008 or&ccedil;amento 2009.</font></p>','<p><font face=\"Verdana\" size=\"2\"><strong><font size=\"4\">1</font></strong> FOMENTO A BACIA LEITEIRA NA REGI&Atilde;O DO M&Eacute;DIO ALTO URUGUAI&nbsp; R$ 829.800,00 <br/>&nbsp;<br/><font size=\"4\"><strong>2</strong></font> VIATURA PICK-UP PARA A BRIGADA MILITAR DO MUNIC&Iacute;PIO DE PLANALTO R$ 120.000,00 <br/>&nbsp;<br/><font size=\"4\"><strong>3</strong></font> RECURSOS PARA AQUISI&Ccedil;&Atilde;O DE EQUIPAMENTOS PARA NOVOS CURSOS T&Eacute;CNICOS NA E.E.T. JOS&Eacute; CANELLAS DE FREDERICO WESTPHALEN R$ 80.000,00 <br/>&nbsp;<br/><strong><font size=\"4\">4</font></strong> REDES DE COOPERA&Ccedil;&Atilde;O REGI&Atilde;O DO M&Eacute;DIO ALTO URUGUAI R$ 290.000,00 <br/>&nbsp;<br/><strong><font size=\"4\">5</font></strong> RECURSOS PARA EQUIPAMENTOS - CORPO DE BOMBEIROS R$ 55.000,00 <br/>&nbsp;<br/><strong><font size=\"4\">6</font></strong> CUSTEIO PARA OS HOSPITAIS S&Atilde;O JOS&Eacute; DE RODEIO BONITO E HOSPITAL DIVINA PROVIDENCIA DE FREDERICO WESTPHALEN R$ 200.000,00 <br/>&nbsp;<br/><strong><font size=\"4\">7 </font></strong>FOMENTO A PESQUISA NA REGI&Atilde;O DO M&Eacute;DIO ALTO URUGUAI R$ 100.000,00 <br/>&nbsp;<br/><strong><font size=\"4\">8</font></strong> GERA&Ccedil;&Atilde;O DE RENDA PARA AGRICULTORES FAMILIARES DO M&Eacute;DIO ALTO URUGUAI R$ 50.000,00 <br/>&nbsp;<br/><strong><font size=\"4\">9</font></strong> CONSTRU&Ccedil;&Atilde;O DE RODOVIAS NA REGI&Atilde;O DO CODEMAU R$600.000,00 <br/>&nbsp;<br/><strong><font size=\"4\">10</font></strong> IMPLANTA&Ccedil;&Atilde;O DE CENTRO DE REFER&Ecirc;NCIA DA CRIAN&Ccedil;A E ADOLESCENTE NA REGI&Atilde;O DO CODEMAU R$ 90.000,00<br/></font></p>',0,14,0,'codemau','',0,'',1,0,0,0,0,'');
INSERT INTO `kayapo_stories` VALUES (16,0,'codemau','Material de divulgação da Consulta Popular 2008/2009','2008-06-17 14:41:04','<p><img style=\"WIDTH: 219px; HEIGHT: 100px\" height=\"322\" alt=\"\" src=\"/modules/FCKeditor/upload/Image/ATENCAO.gif\" width=\"263\"/></p>','<p align=\"justify\"><font face=\"Verdana\" size=\"2\">Os Munic&iacute;pios que ainda n&atilde;o retirar&atilde;o o material de divulga&ccedil;&atilde;o da Consulta Popular 2008 or&ccedil;amento2009, poder&atilde;o retirar o mais r&aacute;pido possivel junto a sede do CODEMAU.</font></p>',0,5,0,'codemau','',0,'',1,0,0,0,0,'');
INSERT INTO `kayapo_stories` VALUES (17,0,'codemau','Entrega material Consulta Popular','2008-06-17 16:13:51','Detacamos que at&eacute; o <strong>dia 19&nbsp;pr&oacute;ximo</strong> todos os munic&iacute;pios que participar&atilde;o da Consuta Popular&nbsp;dever&atilde;o mandar&nbsp;a <strong>quantidade de urna e seus respectivos&nbsp;locais</strong>, destacamos ainda que no dia <strong>23/06 &aacute;s 14 horas</strong> no audit&oacute;rio da URI - Campus de Frederico Westphalen uma reiuni&atilde;o onde ser&aacute; entregue o material para a Consulta Popular 2008/2009','<p align=\"justify\"><font face=\"Verdana\" size=\"2\">Na oportunidade em que vimos solicitar&nbsp;o mais&nbsp;breve poss&iacute;vel,&nbsp;&nbsp;<strong>no m&aacute;ximo at&eacute; o dia 19</strong> pr&oacute;ximo &agrave; quantidade de urnas que ser&atilde;o utilizadas no dia da Consulta Popular que ocorre no pr&oacute;ximo dia 25, durante todo o dia. Solicitamos tamb&eacute;m que nos seja informado o local que ser&atilde;o instaladas essas urnas, em virtude de divulgarmos no site da Consulta Popular e tamb&eacute;m por solicita&ccedil;&atilde;o do pr&oacute;prio Coordenador Estadual da Consulta Popular. </font></p><p align=\"justify\"><font face=\"Verdana\" size=\"2\">Aproveitamos a oportunidade para convidar vossa senhoria para uma importante <strong>reuni&atilde;o e entrega dos materiais para a realiza&ccedil;&atilde;o da Consulta Popular</strong>, a reuni&atilde;o ser&aacute;&nbsp; no dia <strong>23 de junho pr&oacute;ximo as 14:00 horas</strong> no Audit&oacute;rio da URI Campus Frederico Westphalen.</font></p><p align=\"justify\"><font face=\"Verdana\" size=\"2\">Destacamos que&nbsp; para a Consulta Popular em nossa regi&atilde;o conseguir &iacute;ndices consider&aacute;veis de participa&ccedil;&atilde;o, o engajamento e&nbsp; empenho do COMUDE, poder executivo e legislativo do munic&iacute;pio &eacute; de suma import&acirc;ncia, haja visto que neste ano todos os munic&iacute;pios ter&atilde;o recursos assegurados, desde que consigam realizar a Consulta Popular de forma organizada e com participa&ccedil;&atilde;o significativa.&nbsp;&nbsp; Salientamos que est&aacute; participa&ccedil;&atilde;o consider&aacute;vel &eacute; de suma import&acirc;ncia para posteriormente pressionarmos e articularmos a libera&ccedil;&atilde;o dos recursos. </font></p>',0,1,0,'codemau','',0,'',1,0,0,0,0,'');
